import React from 'react'
import { Ancla } from '../Ancla/Ancla';


export const NavegacionInicio = (estilo) => {
  return (
    <nav>
      <Ancla estilo="ancla" textoAncla="Inicio"/>
      <Ancla estilo="ancla" textoAncla="Productos"/>
    </nav>
  )
}
